import React from 'react';
import './content_review.css';
import CardFeaturs from './card_content/card_content';
import CardFeature from './card_content/card_review_feature.js'


class ContentReview extends React.Component{
  render(){
    return(
      <div id="contentreview">
        <CardFeaturs func="CardFeature"/>
      </div>
    )
  }
}
export default ContentReview
